import React, {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import APIInvoke from '../../utils/APIInvoke';
import swal from 'sweetalert';

const CrearCuentaUsuario = () => {

    const [usuario, setUsuario] = useState({
        nombre: "",
        email: "",
        password: "",
        confirmar:"",

    });

    const {nombre, email, password, confirmar} = usuario;

    const onChange = (e) => {
        setUsuario({
            ...usuario,
            [e.target.name]: e.target.value
        })
    }   

    useEffect( () => {
        document.getElementById("nombre").focus();
    },[])

    const crearCuentaUsuario = async () => {

        if(password !== confirmar){
            const msg = "Las contraseñas son diferentes.";
            swal({
                tittle: 'Error',
                text: msg,
                icon: 'error',
                buttons: {
                    contirm: {
                        text: 'Ok',
                        value: true,
                        visible: true,
                        className: 'btn btn-danger',
                        closeModal: true
                    }
                }
            });
        }else if(password.length <6){
            const msg = "La contraseña debe tener al menos 6 caracteres.";
            swal({
                tittle: 'Error',
                text: msg,
                icon: 'error',
                buttons: {
                    contirm: {
                        text: 'Ok',
                        value: true,
                        visible: true,
                        className: 'btn btn-danger',
                        closeModal: true
                    }
                }
            });
        }else{
            const data = {
                nombre: usuario.nombre,
                email: usuario.email,
                password: usuario.password
            }
            const response = await APIInvoke.invokePOST(`/api/usuarios`, data);
            const mensaje = response.msg;

            if(mensaje === 'El usuario ya existe'){
                const msg = "El usuario ya se encuenta registrado.";
                swal({
                tittle: 'Error',
                text: msg,
                icon: 'error',
                buttons: {
                    contirm: {
                        text: 'Ok',
                        value: true,
                        visible: true,
                        className: 'btn btn-danger',
                        closeModal: true
                    }
                }
            });
            }else {
                
            const msg = "El usuario fue creado correctamente.";
            swal({
                tittle: 'Información',
                text: msg,
                icon: 'success',
                buttons: {
                    contirm: {
                        text: 'Ok',
                        value: true,
                        visible: true,
                        className: 'btn btn-primary',
                        closeModal: true
                    }
                }
            });

            }




            setUsuario({
                nombre: "",
                email: "",
                password: "",
                confirmar:"",
            })
        }
        
    }


    const onSubmit = (e) => {
        e.preventDefault();
        crearCuentaUsuario();
    }   
    return (  
        <div className="hold-transition login-page">
        <div className="login-box">
            <div className="login-logo">
                <Link to={"#"}><b>Registar</b> Usuario</Link>
            </div>
            {/* /.login-logo */}
            <div className="card">
                <div className="card-body login-card-body">
                    <p className="login-box-msg">Ingrese los datos de usuario.</p>
                    <form onSubmit={onSubmit}>
                        <div className="input-group mb-3">
                            <input type="text" 
                                 className="form-control"
                                 placeholder="Nombre" 
                                 id="nombre"
                                 name="nombre"
                                 value = {nombre}
                                 onChange = {onChange}
                                 required 
                            />
                            <div className="input-group-append">
                                <div className="input-group-text">
                                    <span className="fas fa-user" />
                                </div>
                            </div>
                        </div>
                        <div className="input-group mb-3">
                            <input type="email" 
                                 className="form-control"
                                 placeholder="Email" 
                                 id="emaile"
                                 name="email"
                                 value = {email}
                                 onChange = {onChange}
                                 required 
                            />
                            <div className="input-group-append">
                                <div className="input-group-text">
                                    <span className="fas fa-envelope" />
                                </div>
                            </div>
                        </div>
                        <div className="input-group mb-3">
                            <input type="password"
                                className="form-control"
                                placeholder="Contraseña"
                                id="password"
                                name="password"
                                value = {password}
                                 onChange = {onChange}
                                 required 
                            />
                            <div className="input-group-append">
                                <div className="input-group-text">
                                    <span className="fas fa-lock" />
                                </div>
                            </div>
                        </div>
                        <div className="input-group mb-3">
                            <input type="password"
                                className="form-control"
                                placeholder="Confirmar Contraseña"
                                id="confirmar"
                                name="confirmar"
                                value = {confirmar}
                                 onChange = {onChange}
                                 required 
                            />
                            <div className="input-group-append">
                                <div className="input-group-text">
                                    <span className="fas fa-lock" />
                                </div>
                            </div>
                        </div>
                        <div className="social-auth-links text-center mb-3">
                            <button type='submit' className="btn btn-block btn-primary">
                                Registrar
                            </button>
                            <Link to={"/"} className="btn btn-block btn-danger">
                                Regresar al Login
                            </Link>
                        </div>
                    </form>
                    {/* /.social-auth-links */}
                </div>
                {/* /.login-card-body */}
            </div>
        </div>
        {/* /.login-box */}
    </div>
    );
}
 
export default CrearCuentaUsuario;
